class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        n = len(s)
        list_str = []
        str_len = 0
        max_len = 0
        start_point = 0
        for i in range(n):
            if s[i] in list_str[start_point:]:
                start_point = s.find(s[i],start_point) + 1
                str_len = i - start_point + 1
                list_str.append(s[i])
            else:
                list_str.append(s[i])
                str_len += 1
            max_len = max(max_len, str_len)
        return max_len

